import React from 'react';

const Users = ({users}) =>(
    <div className="DivUsers">
        <div className="DivAvatar"><img src={users.avatar_url} alt={users.login} />;</div>
        <div className="DivInfos">
            <div className="DivInfos">{users.login}</div>
            <div className="DivInfos">{users.type}</div>
            <div className="DivInfos">{users.score}</div>
        </div>
    </div>
)

export default Users;
